def is_prime(n, primes):
    for prime in primes:
        if n % prime == 0:
            return False
        if prime * prime > n:
            break
    return True

def generate_primes(limit):
    primes = [2]
    i = 3
    while len(primes) < limit:
        if is_prime(i, primes):
            primes.append(i)
        i += 2
    return primes

